import logo from './logo.svg';
import './App.css';
import CreateModpack from './components/CreateModpack/CreateModpack';
import { useState } from 'react';

function App() {

  const [showCreateModpack, setShowCreateModpack] = useState(true);

  return (
    <div className="App">

    {showCreateModpack && (
       <div className='app-create-modpack-container'>
       <CreateModpack />
     </div>     
    )}

    </div>
  );
}

export default App;
